import React from 'react'
import { Accordion, AccordionSummary, Box, Divider } from '@mui/material'
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

function UnitColumn(props) {
  return (
    <Box sx={{
        display: 'flex',
        flexDirection: 'column',
        height: '600px',
        width: '150px',
        bgcolor: "#0B3C5D"
    }}>
        <img src={require('../img/ships/Cruiser.png')} alt="" style={{height: '50px'}}/>
        <Divider variant="middle" sx={{bgcolor: '#D9B310'}}/>
        <Accordion>
            <AccordionSummary expandIcon={<ExpandMoreIcon />}>

            </AccordionSummary>
        </Accordion>
    </Box>
  )
}

export default UnitColumn
